import {React, useState} from 'react'
import './Nav.css'
import MenuIcon from '@material-ui/icons/Menu';
import ClearIcon from '@material-ui/icons/Clear';
import HomeIcon from '@material-ui/icons/Home';


function Nav() {

    const [toggle, settoggle] = useState(false)
    const Toggle = () =>{
        settoggle(!toggle)
        console.log(toggle)
    }
    const closeMenu = () => {
        settoggle(false)
    }

    return (
        <div className="header">
            <div className="logo-nav">
                <div>
                    <a href="#home" onClick={()=>{closeMenu()}}>Pranavdhar</a>
                </div>
                <div className={toggle? "nav-options active" : "nav-options"}>
                        <a onClick={()=>{closeMenu()}} href="#home">Home</a>
                        <a onClick={()=>{closeMenu()}} href="#about">About</a>
                        <a onClick={()=>{closeMenu()}} href="#home">Skills</a>
                        <a onClick={()=>{closeMenu()}} href="#projects">Projects</a>
                        <a onClick={()=>{closeMenu()}} href="#blogs">Blogs</a>
                        <div>
                            <p>Bulb</p>
                        </div>
                </div>
            </div>
            <div className="mobile-menu" onClick={() =>{Toggle()}}>
                {toggle ? (
                    <ClearIcon className="menu-icon" />
                    ) : (
                    <MenuIcon className="menu-icon" />
                )}
            </div>
        </div>
    )
}

export default Nav
